import Header from './Header';
import { Head } from 'next/head';

const layoutStyle = {
    margin: 20,
    padding: 20,
    border: '1px solid #DDD'
};

const withLayout = Page => {
    return () => (
        <div style={layoutStyle}>
            <Head>
            </Head>
            <Header />
            <Page />
        </div>
    );
};

export default withLayout;
